import { Switch, Route, BrowserRouter, NavLink } from "react-router-dom";
import logo from './logo.svg';
import './App.css';

const Header = (props) => {
  return (
    <div className='header-container'>
      <h1 className="header-oponn">Oponn</h1>
      <div className="header-links-container">
        <NavLink to="/" exact={true} activeClassName='selected-link' className={props.header_items}>Home</NavLink>
        <NavLink to="/current" activeClassName='selected-link' className={props.header_items}>Curation</NavLink>
        <NavLink to="/fiveday" activeClassName='selected-link' className={props.header_items}>Curation</NavLink>
      </div>
      <div className="line-container">
        <hr className='line-black' />
      </div>
    </div>
  )
}

function App() {
  return (
    <div className="App">
      <Header />
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
